CREATE DATABASE IF NOT EXISTS nasdaq_db;

use nasdaq_db;

DROP TABLE IF EXISTS nasdaq;
CREATE TABLE nasdaq(
    Symbol       VARCHAR(5)       PRIMARY KEY,
    Name         VARCHAR(100),
    Market_Cap   FLOAT,
    Country      VARCHAR(20),
    IPO_Year     FLOAT,
    Sector       VARCHAR(30),
    Industry     VARCHAR(100),
    Company_Size FLOAT
);


SELECT COUNT(*) FROM nasdaq;
SELECT * FROM nasdaq;